import React from 'react';
import './header.css';
import '../public.css';
import { useNavigate } from 'react-router-dom';

function Header(props) {
  const navigate = useNavigate();
  const isLogin = props.isLogin
  return (
    <header>
      <nav>
        <ul>
          <li onClick={()=>{navigate("/", {state:{isLogin:isLogin}})}}><a className="big-title">BERKERLEY APARTMENTS</a></li>
        </ul>
        <ul>
          <li onClick={()=>{navigate("/tutorial", {state:{isLogin:isLogin}})}}><a href="#">How it Works</a></li>
          <li onClick={()=>{navigate("/signin", {state:{isLogin:isLogin}})}}><button className='white-button'>Sign in</button></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
